import React from "react";
import { Container, Paper } from "@material-ui/core/";
import MaterialTable from 'material-table'

export const SearchResults=() => {
  // const searchResults = "Search Results go here.";

 const columns=[
   {
     title:'firstName', field:'first_name', render:(row)=>{
      return `${row.first_name} ${row.last_name}`;
    }
   },
   {
     title:'lastName', field:'last_name'
   }
 ]

const data=[
  {name:'Willie', last_name:'Jones'},
  {name:'Tara', last_name:'Didon'},
  {name:'Timothy', last_name:'Chiu'},
  {name:'Bob', last_name:'Boswell'}

]

const newData = {
  fullInfo: data.name + ' ' + data.age
}


  


  return (
    <Container>
      <Paper>
        <MaterialTable title="Material Table"
          columns={columns}
          data={data}
        />
      </Paper>
    </Container>
  );
}

export default SearchResults;
